import React from "react";


const Groups = () => {

    const [lg, setState] = React.useState([
        {id:1, img:"../img/cake.jpeg", name:"cake group"},
        {id:2, img:"../img/cake.jpeg", name:"cake group"},
        {id:3, img:"./img/cake.jpeg", name:"cake group"},
        {id:4, img:"./img/cake.jpeg", name:"cake group"},
        {id:5, img:"./img/cake.jpeg", name:"cake group"},
        {id:6, img:"./img/cake.jpeg", name:"cake group"}
    ]);

    return (
        <div>
            {lg.map((i) => (
            <div key = {i.id} >
                <div>
                    <img src={i.img} />
                </div>
                <div> {i.name} </div>
            </div>
            ))}
        </div>

    )
}

export default Groups;
